import './index.css'
function App() {
  return (
    <div className="bg-gray-100">
      <form>
        <fieldset>
          <legend>Contact</legend>
          Name <input type="text"/><br/>
          Email <input type="text"/><br/>
        </fieldset>
        </form>
    </div>
  );
}

export default App;
